import React from 'react';
import './ReviewerDashboard.css'; // Import the CSS file

const ReviewerDashboard = () => {
  const handleLogout = () => {
    window.location.href = '/login';
  };

  return (
    <div className="dashboard-container">
      <h1 className="dashboard-title">reviewer dashboard</h1>
      <button className="logout-button" onClick={handleLogout}>logout</button>
      <div className="dashboard-section">
        <h2 className="section-title">in review</h2>
        <div className="assignment-placeholder">Assignment 1</div>
        <div className="assignment-placeholder">Assignment 2</div>
      </div>
      <div className="dashboard-section">
        <h2 className="section-title">submitted for review & resubmitted</h2>
        <div className="assignment-placeholder">Assignment 3</div>
        <div className="assignment-placeholder">Assignment 4</div>
      </div>
      <div className="dashboard-section">
        <h2 className="section-title">completed</h2>
        <div className="assignment-placeholder">Assignment 5</div>
        <div className="assignment-placeholder">Assignment 6</div>
      </div>
    </div>
  );
};

export default ReviewerDashboard;
